TITANIA Lime Forme Pieds - 3026

TITANIA Lime Forme Pieds&nbsp;propose deux côtés, une pierre ponce et une émeri, pour des pédicures douces.&nbsp;En conjonction avec l'eau (avec ou sans savon) élimine même la saleté la plus profondément enracinée ainsi que les taches de nicotine, l'encre, l'huile, les taches de couleur. Fonctionne rapidement, facilement et en toute sécurité pour aider à restaurer la douceur naturelle de la peau.

Commencez avec le côté ponce pour éliminer la peau dure ou calleuse et terminez avec le côté émeri.&nbsp;

