Elle est destiné&nbsp;pour les enfants et les bébés à partir de 6 mois.

&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  Cette brosse nettoyante visage à la tête rotative et résistante aux éclaboussures se présente sous la forme de divers accessoires et donne la promesse par sa capacité de soin d'apporter un Eclat du Visage, le résultat d'une Peau Parfaite, un Nettoyage en profondeur et Nettoie ainsi que Revigore.

